4. Justificativas da Contratação

Pertinência ao Plano de Desenvolvimento Institucional: A atividade está alinhada à estratégia de valorização dos servidores e promoção de ações integradas de capacitação e bem-estar funcional;

Complementaridade: A palestra integra a programação de um evento técnico (que inclui oficinas especializadas), sendo sua abordagem voltada ao desenvolvimento humano, em consonância com os princípios de valorização do servidor público;

Impacto organizacional: Espera-se que a palestra promova melhorias na motivação, engajamento, clima organizacional e desempenho das equipes, com repercussões positivas na qualidade dos serviços prestados;

Caráter motivacional e inspiracional: Por se tratar de conteúdo não técnico, não são exigidas formações específicas ou certificações normativas, sendo a experiência comprovada do palestrante o critério central de seleção;

Economicidade: O valor estimado para a contratação é de R$ 1.000,00 (mil reais), com base em pesquisa de mercado e proposta prévia compatível com eventos de porte semelhante, considerando a natureza única e pontual da atividade.

