A presente contratação da musicista Clara Gomez para apresentação voz e violão tem por objeto a prestação de serviços musicais durante o evento VI Jornada Científica 2025, a ser realizado no dia 11 de novembro de 2025, no Palácio da Justiça, em Teresina-PI, de modo a estreitar os laços entre os colaboradores, promover o trabalho em equipe, aprimorar o relacionamento interpessoal e, consequentemente, melhorar a eficiência e eficácia das atividades desenvolvidas pelo órgão;
O lazer é tutelado como direito constitucional, encartado entre os direitos sociais no artigo 6° da Constituição da República. Na forma do art. 217, §3°, da Carta Magna. Nesse sentido o Poder Judiciário Piauiense incumbe uma obrigação de fomentar o lazer e a cultura como forma de promoção social. Destarte, o art. 215 estabelece que o Estado deve garantir a todos o pleno exercício dos direitos culturais e o acesso às fontes de cultura nacional, bem como apoiar e incentivar a valorização e a difusão das manifestações culturais.
A participação da musicista para apresentação voz e violão agrega valor cultural e simbólico ao evento, proporcionando um momento de convivência harmoniosa e de celebração coletiva, por meio de um repertório que destaca músicas regionais e elementos da cultura piauiense, reforçando a identidade cultural local e tornando o evento mais atrativo, dinâmico e significativo para os participantes.
